policy_welcome: "Welcome to theMugHermit&#39;s Etsy store. Hidden away from normal folk, the mug hermit designs and prints a range of fun and unique gift mugs. I select the very highest quality materials to produce your mug. Even though the mugs could be produced much cheaper, I understand that your order is most likely going to be a gift for someone, so I am not going to send you embarrassing tat. All designs are permanent, printed on both sides and dishwasher safe. Love your mug!",
