policy_refunds: "Returns: I am happy to accept returns provided the item is new and undamaged. I cannot accept returns for personalised/ custom orders. Buyer is responsible for return shipping costs. Damaged Goods: Please contact me within 48 hours should your item arrived damaged. Please retain all packaging. I may ask for photographic evidence when items are damaged. Please contact me using Etsy messages if you have any problems with your order. All UK orders covered by UK Consumer Contracts Regulations.",
