is_vacation: false,
vacation_message: "We are taking a vacation. We will reopen August 30. Please message us at Engravingpro2@gmail.com or visit us at www.etsy.shop/engravingpro Thank you for visiting our shop! Respectfully, AK Laser Kellie and Adam",
sale_message: "Thank you for visiting our Etsy shop, www.etsy.com/shopaklaser and for making a purchase! This e-mail confirms your purchase. Most orders will be processed and shipped within 3 to 5 BUSINESS Days*** The order invoice includes the ship date (located above your name and address). We will email you a shipping notification and TRACKING when your package has shipped. We guarantee our custom work 100 percent. If there&#39;s a mistake we made with your order, feel free to contact us via &#39;Etsy conversations&#39;, we will ship you another (corrected) item at our cost! Packages shipped INTERNATIONALLY can take up to 3 or 4 weeks for delivery. If this conflicts with your deadline, please contact us as soon as possible via &#39;Etsy conversation&#39;. Our INTERNATIONAL customers will be responsible for all import taxes, duties, VAT and/or handling fees that may be applied on different imported merchandise by your countries. The fees, are collected at the time of customs clearance, and your merchandise/package may be held at your local (Postal Office) or other location until the fees are paid. Please see our shop policies for more information. Please note: +++Please wash the engraved FLASKS (by hand) thoroughly inside and out before using. Please contact us if your have any questions and/or concerns! www.etsy.com/shop/aklaser 360.667.0380 Respectfully, AK Laser",
digital_sale_message: null,
