policy_shipping: "We ship via USPS within 1-3 business days after your payment has cleared. We use USPS 1st class mail which is much slower than Priority so please be patient. We do not buy delivery confirmation nor insurance. If you would like either you can convo us for pricing and we will set up a reserved listing for you. All orders are handmade to order. As per etsy&#39;s policies, if you have two different addresses it is up to you, the buyer, to inform us, the etsy seller, as to which address to use. Etsy gives us the right to refuse any sale that we think may be one of credit card fraud. As with our regular &quot;Lost Order&quot; policies we do not cover, refund nor send a replacement orders for lost orders and we especially do not for those orders that were shipped to a third party (gift recipient, anyone other than your place of residence). In the event that your order is returned to us, we are happy to ship your order to you again however you will have to pay the shipping costs. Please email us for our paypal address and details. You will have 5 business days to send us the money to reship. We are not responsible for your order after that and buyer will have to consider it a loss on their part. **INTERNATIONAL CUSTOMERS ONLY** Please allow at least 4-6 weeks for your order to arrive if you do not contact us about other shipping options before ordering as your order will ship USPS First Class International Mail without tracking. If you would like tracking and to guarantee arrival within a week please contact us before purchasing to arrange for International USPS Express Mail which can be rather pricey. ****IMPORT FEES**** It&#39;s the customer’s responsibility to pay any type of import and/or tax fee that your country imposes as these fees are unique to your country. Please contact your local post office to learn more. For those of you in the UK can read more about it here: http://www.hmrc.gov.uk/customs/tax-and-duty.htm",
policy_refunds: "If there is a problem with your order you have &quot;30 days&quot; from the date your order was shipped to contact us. In purchasing with us you agree to these terms of our sale. If there is a problem with your order please convo us before leaving feedback so that we can work together to resolve the matter. If we make a mistake with your order we will do all we can to fix it. On Lost Packages: If you do not receive your package and it is lost, we cannot trace it unless you bought a &quot;Delivery Confirmation&quot;. We cannot refund your money, nor send you another product to replace it as we cannot be held responsible for something the Post Office lost, or a customer who provided an outdated address, or an incorrect one, or who did not opt to buy Delivery Confirmation or insurance. If your order is lost please check with your Postal Carrier. Our packages do not fit in most mail boxes. Many times the carrier will leave a note that delivery was attempted. If you do not get a note, you may need to speak with the postal carrier. Often the order will be returned to us which can take as long as 30 days. If it is returned to us please see our policy. IMPORTANT: We do not replace prints nor give refunds for lost orders unless the customer buys a Delivery Confirmation for their order. Otherwise we cannot track your package. On those orders that are lost, if the buyer purchased a delivery confirmation we will only send new prints on a case by case basis. ",
