announcement: "**Our prices are FALLing this season! Take 10% off any purchase up to $75, take 15% off any purchase from $75 to $185, take 20% off any purchase over $185. Please see coupon codes below** *All orders within the USA are posted via USPS PRIORITY Mail for speed and safety* Looking for that perfect gift for a hard to buy for Man? You are in the right place. Check out the Ultimate Man Shop&#39;s range of Cool & Unique gifts for Men. We have gifts for Men in Weddings, at Birthdays, Christmas, Graduations, Retirements, Anniversaries, Fathers Day, Valentines Day and more. Our turn around time is also very fast (3 to 5 days depending on the amount) so your Custom Engraved order will be with you in no time. Have a Custom Order idea but can&#39;t see it in our shop? No problem, just send us a message and we will see what we can do. **Please note, despite the shipping times being set to 1 - 2 weeks, our speedy turn around will have your order dispatched ASAP, usually 7 days. During the busier times of the year (Christmas / Wedding Season), it can take longer but generally no more than 12 days - If you need something by a specific date just let us know and we will get it to you.** Coupon Codes active from October 1st 2015 to December 31st 2015 - FALLSALE10 - 10% off any purchase up to $75 FALLSALE15 - 15% off any purchase between $75 and $185 FALLSALE20 - 20% off any purchase over $185 ",
