vacation_message: "Hi there, thank you for stopping by, currently The Ultimate Man Shop is closed for Christmas Vacation whilst I am out of the country. Thank you very much for your interest, all listings in the shop will be available again from January 9th 2015. Have an awesome winter vacation! Kindest Regards, Joe The Ultimate Man Shop",
sale_message: "Thank you for shopping with The Ultimate Man Shop. Your order is confirmed and we will contact you if there are any questions with regards to the engraving instructions. Your custom order will be made and posted ASAP. With Best Wishes, Joe, Richard, Samantha and Lily the Dog. (The Ultimate Man Shop Team)",
