announcement: "Thank you for stopping by at my corner of Etsy! Most of my designs are made to order and ship within 3-5 days of purchase. If you need something faster send me a message and I will do my best! Every purchase arrives gift wrapped and without price tags or receipt. I&#39;m happy to customize my designs for you!",
