policy_welcome: "Thank you for visiting my store :)",
policy_payment: "Please make your payment immediately upon checkout. If your payment is delayed for any reason please contact me. If I have not heard from you and payment is not received within one day of checkout, the purchase will be canceled. You can make a secure payment through PayPal. If you do not have a PayPal account, you can still use their service to safely use your credit or debit card. CUSTOM ORDERS All custom orders payments are due upfront. I will send images of your piece for your approval before sending it.",
policy_shipping: "Most items in my store are made to order. I make every effort to ship them within usual 3-5 business days. In case of any unusual delays I will contact you. I use USPS First Class shipping. If you would like to upgrade to Priority or Express shipping, this can be done for an additional charge. Please convo me ahead of time so I can make a listing especially for you. All items arrive gift wrapped in a cotton filled boxes and a ribbon and are shipped in a bubble envelope. International Shipping It can take up to 2 weeks or longer for the packages to arrive in some countries due to the mere distance, customs procedures, and swiftness (or lack of it) of the post office. Please be advised that the European Union countries apply customs charges for items of value bigger than 35 euro.",
policy_refunds: "I want you to be absolutely happy with your purchase. Please let me know if there are any problems at all before leaving feedback so we can resolve the issue. If you are unhappy with your purchase, you can return it within 5 business days for a full refund minus the shipping charge. Please convo me before returning an item. The item has to be in unused condition and I expect you to package in the original packaging. CUSTOM ORDERS I don&#39;t accept returns on custom orders. I can make changes but that will involve additional charges. Custom orders take long time to make and in most cases are not suitable for resale. After you approve it the item it is shipped and the sale is final.",
policy_additional: "Most of my items are made to order. The pictures are design guidelines, which I try to follow closely. Some variations - due to the nature of the creative process and the uniqueness of the natural materials used - are unavoidable. Taking Care of Your Handmade Pieces Hand made pieces and natural stones require more care in handling than mass produced ones. Please store them separately to prevent from tangling, avoid tossing hem in the bottom of your handbag, sleeping or working out wearing them. You will enjoy them much longer. Repair I will gladly repair any damage that might have happen to your piece due to a normal wear and tear for a very reasonable fee plus shipping. Special Requests I&#39;m open to suggestions including metals, colors and finishes to my listings. There&#39;s a world of possibilities out there :) If you have any questions at all, please feel free to convo me without hesitation. I am more than happy to customize pieces for you and if you like an item that is already sold, I probably will be able to make it again.",
