title: "Will You Be My Groomsman - Bridesmaid - Best Man - Whiskey Style Labels - Ask Groomsman - OR Groomsman Gift - Wedding Party - Set of 6",
description: "Ask or thank your Groomsmen & Best Man in this unique way – with custom whiskey labels! ▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬ TO CUSTOMIZE YOUR LABELS ▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬ At checkout, please include the following in the NOTES TO STUDIOBLABELS: 1. First Name of BEST MAN 2. First Names of GROOMSMEN 3. Your married LAST NAME 4. Wedding DATE/or season/year if not yet determined 5. Wedding LOCATION (city, state or country) 6. FIRST INITIALS of Bride and Groom (initials in the order you prefer on label) 7.* FIRST NAME of Groom (for Groom label if extra available) Select LABEL PURPOSE from the drop-down menu at checkout: 1. Be my Groomsman/Best Man? 2. Thank you for Being My… 3. Title Only such as “Groomsman” “Best Man” or “Usher” Select TOTAL LABEL QUANTITY from the drop-down menu at checkout. Labels are printed 6 to a sheet and the price is the same for 6 or less. Fun extras, generics or duplicate labels are always sent to reach the minimums. ▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬ ABOUT THESE LABELS ▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬ These labels come in a set of 6 (SIX), professionally printed on weatherproof semi-gloss stock. Each individual label measures 3.33” wide x 4” tall, perfect for 375 mL flask bottles. They also fit the large 750 mL bottle, however the label is slightly smaller than the original. The labels read: NAME FIRST INITIALS OF BRIDE AND GROOM WEDDING YEAR BE MY Groomsman/Best Man? OR THANK YOU for being my Groomsman/BM OR Groomsman/Best Man/Usher (etc) DATE • LOCATION THE (LAST NAME) WEDDING PARTY For the ladies too! Just please note this on your order along with bridesmaids, Maids/Matrons of Honor, etc. Proofs are available by request only. Please note a PROOF REQUEST on your order notes at check out! Proofs are typically sent via Etsy Messages 1 day prior to shipment. Failure to approve proof may delay shipment. ▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬ SHIPPING ▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬ US STANDARD: Typically 6-8 business days to your door from placing order PRIORITY: Typically 5-6 business days to your door from placing order RUSH: Next day turnaround with PRIORITY shipping. Typically 3-4 business days to your door. EXPRESS: Next day turnaround with EXPRESS shipping. Typically overnight or 2nd day service (varies on location) and is the only shipping option that is guaranteed by USPS. A tracking number will be sent upon shipment and details regarding your shipping date can be viewed on your &quot;Purchases&quot; page. For additional shipping information, including international shipping times, please see Shipping Section on shop Policies Page. USPS does experience rerouting and delays from time to time. Standard International delivery is typically 2-3 weeks. Need this order RUSHED??! Purchase expedited printing and shipping from the drop down at check out! Each line can be customized as requested based on fitting. Custom requests must be made IN CAPS in a separate sentence with as much detail as possible. ▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬ OTHER IMPORTANT INFO ▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬ The old labels definitely look best removed and it’s pretty simple to do! Complete instructions come with each order. Please read shop “Policies” for more information. Sadly whiskey is not included. This listing is for labels only. :) A gift not soon forgotten! Happy Wedding Planning!",
