title: "Custom Wine Labels for Weddings, Bridesmaids & More ",
announcement: "As featured on Martha Stewart Weddings! Welcome to Studio B Label Co on Etsy, where you will find a large selection of beautiful custom wine labels for weddings, bridesmaids, groomsmen, anniversaries, holidays and so much more! As one of the original wine label companies, we pride ourselves on having a stellar customer experience, from staying on top of the latest trends in our designs to having one of the fastest turnaround times (just 2 business days). We also offer several expedited options for those last minute ideas! Follow us on Instagram at: https://instagram.com/studioblabels/ Be sure to like us on Facebook to receive special offers at www.facebook.com/studioblabels ",
currency_code: "USD",
is_vacation: false,
vacation_message: "Merry Christmas! We are on a long-awaited holiday vacation and spending some QT with friends and family!! Although my husband might put up a fight, I would have brought my 1,265 lb printer with me if I could. Lucky for him, it wouldn&#39;t fit in the trunk ;). So... We are forced to enjoy the holidays sans work. We will be back December 30th and begin furiously working on your orders. If you are in a time crunch, please note this on your order at checkout and we&#39;ll do our best to get your fabulous labels to you on time. Wishing everyone a Merry Christmas and a safe holiday season! Happy Everything! Rachel",
sale_message: "Thank you so much for your purchase! Please like us on facebook to keep up with what&#39;s new and specials! We also would love the see the fun photos, laughs, tears, and moments capturing your unique wine labels! https://www.facebook.com/studioblabels ENTER OUR PHOTO CONTEST on facebook and win by submitting your best moments with your bottles and crew! Get creative and show those babies off! See our facebook page or message me for contest rules. Winners chosen monthly and receive a gift certificate!",
digital_sale_message: "Thank you for your order! These are typically set up to printed on a standard letter sized sheet and each label should be cut to approximately 4&quot; x 3.25&quot;. Typically you can use a full shipping label and have it printed on any commercial printer. For instance Office Depot, etc all can print for $0.70 per copy and can even cut it for you! Or you can send the file to a printer and they will print on cut on their professional machines. If you are printing labels instead of tags I do not suggest purchasing pre-cut (Avery for instance) labels and attempting to line up the file to their layout. It is definitely easiest to print the file on a full sheet and cut to your dimensions! Hope they are a hit! Rachel",
last_updated_tsz: 1445737426,
listing_active_count: 163,
login_name: "RDMULLET",
accepts_custom_requests: false,
policy_welcome: "Thank you for visiting Studio B Label Co! Want something you don&#39;t see in the shop? Just message me with your requests!",
policy_payment: null,
policy_shipping: "Standard orders in the US ship in 2 business days and are typically 3-5 business days once shipped (or 5-7 business days to your door from the time of placing your order.) I also offer 3 expedited services you can choose at check out. 1) PRIORITY SHIPPING $3.50 upgrade- Typically 4-6 business days to your door. 2) RUSH $12.00 upgrade - Ships next business day PRIORITY Typically 3-4 business days to your door from placing order. Insurance included. 3) EXPRESS $26.45 upgrade - Next day (or same day if possible) turnaround and EXPRESS shipping (typically 1-2 day service). 1-3 days to your door from placing order. Insurance Included. Please keep in mind RUSH EXPRESS is the only shipping option guaranteed by USPS! You can purchase any of these shipping upgrades at check-out under &quot;Shipping&quot; if needed. INSURANCE: Please note that PRIORITY, RUSH & EXPRESS services include insurance for lost or damaged mail. Standard shipping does NOT include insurance. Please purchase an upgraded shipping option if you wish to insure your package! USPS and I have a love/hate relationship. I love their prices (and so do you) but I hate it when they don&#39;t deliver on time. Ug. Which takes me to my next point-- USPS DOES NOT GUARANTEE ANY SHIPPING TIMES WITH THE EXCEPTION OF EXPRESS. Sad but true. Express in most cases, is overnight delivery and is a flat rate of $21.45 to US residents. For those of you willing to fork it over, please message me for Express delivery option. Keep in mind if you need 2 day turnaround to your door--you&#39;d need to purchase the RUSH option as well. This bumps you to the front of every line. USPS recognizes M-F as considered &quot;Postal Business Days&quot;. Please keep this in mind when doing the math on when to expect your order! So in a nutshell: Standard Shipping (5-7 business days to your door) PRIORITY Shipping (4-6 business days to your door) RUSH Shipping (3-4 business days to your door) EXPRESS Shipping (2 business days to your door excluding extreme rural areas which is 3 business days) USPS guarantees this method or your shipping money back. Purchase an upgraded shipping option to insure your package. I have had very few issues with the USPS however it does happen. Typically 5 out of every 100. I take a lot of pride in my labels as they are all edited one at a time--Trust me when I say I would hand deliver them if I could! :) INTERNATIONAL SHIPPING: International shipping is typically 2-3 weeks depending on its destination and how long it takes to process through customs (which always varies.) USPS does not guarantee these shipping times and from time-to-time there are significant delays in Customs. USPS does offer guaranteed services (which are super expensive but again, guaranteed.) Please message me directly if you are interested in International guaranteed USPS delivery. 7-11 Day RUSH International Ship (Business Days) $30.50 USD 9-14 Day International Shipping (Business Days) $25.50 USDD 4-6 Day RUSH International Shipping $45.75 USD ***PLEASE NOTE from time to time International buyers are forced to pay customs fees and/or taxes that are levied on many packages being imported into some countries. Because sellers are unable to predict what fees, if any, certain countries will apply, Etsy does not hold sellers responsible for unexpected customs fees or taxes. In my experience I have only seen this through Royal Mail. Just a heads up!",
policy_refunds: "Due to the custom nature of the product, we cannot offer refunds, returns or exchanges once the design process has begun. However, I believe in happy customers so please discuss any issues you have with your order and I will do everything possible to ensure I&#39;ve exceeded your expectations!",
policy_additional: "It is important to include all requested info needed to complete your order. Missing information will likely delay your order shipment. Design changes or capitalization requests must be stated separately at check out. Abbreviations are made where necessary. Proofs are available at no charge based on request! Please note a &quot;PROOF REQUEST&quot; on your order at check out if interested! Proofs must be approved within 14 days or will be shipped as-is. Please also note that some designs have all lowercase font (disregarding proper noun capitalization) per their design -- although this is intended and recommended it can be changed if stated in a separate sentence as a &quot;request for proper noun capitalization&quot;",
policy_seller_info: null,
