sale_message: "♥ ALL SALES ARE FINAL I do my best to describe and photograph items as accurately as possible but please keep in mind my vintage items are old and therefore have some wear and tear. Please feel free to contact me with any questions before purchasing, if you feel the item you have purchased has been misrepresented and your grievance was not covered in my description of the item or in the pictures and you can prove to me the discrepancy was not described, I will accept the item back and will refund your purchase price in full. ♥ Due to the nature of my business, I am unable to accept returns or to pay out refunds in the case of an item not fitting. I meticulously measure every item and display those measurements in my item descriptions. I highly recommended that you measure a similar garment in your wardrobe that fits you well and compare those measurements with those in my item descriptions so that there will be no surprises when your item arrives. If you need any additional pictures or information, I am happy to oblige. ♥ INTERNATIONAL AND DOMESTIC SALES : ON ALL INSURED PACKAGES IF THERE IS BREAKAGE OR DESTRUCTION DURING SHIPPING PLEASE PHOTOGRAPH THE DAMAGE & SEND PHOTOS SO I CAN REIMBURSE YOU. ♥ I do not clean my clothing items that is up to the buyer. I will clean shoes and purses with alcohol if the item supports it. I do not sell smoke scented items. Some of my clothing items may have perfume odors. I clean household, ceramics, glass and jewelry with alcohol if the items support it. I clean suede with suede brushes. Antique items with various patinas, etc, I do not clean, I dust them. ♥ ",
digital_sale_message: null,
last_updated_tsz: 1445732842,
listing_active_count: 498,
login_name: "RadicallyRetro",
accepts_custom_requests: false,
policy_welcome: "What Woman doesn’t like to shop?? I started my love affair with vintage items when I was 16 years old and an aspiring Drama Queen. Mr. Graves, my Drama teacher drove me down to the Salvation Army and helped me pick out my costumes for Adelaide in “Guys and Dolls” and it changed my views on purchasing store bought things forever. Thrift stores, Church Bazaars, Flea Markets, Estate Sales and other people’s closets became my choice of getting my shop on and through the years my eyes and my intuition have become honed to seeing and feeling the magic of the many vintage pieces you will be finding here at RADICALLY RETRO. I love finding the wonderful treasures I will be sharing with you all, each one a testimony to the past with it’s own distinctive memories residing within the silk, rayon, cotton, wool, leather, fur, metal, gemstone, crystal, glass, wood, china, or paper items that will be gracing my shop. Every design an echo of the cultural expression of the era in which it was born. Vintage treasures from the turn of the Century to 1992. RESPECTFULLY- RECYLED & RESTORED AT RADICALLY RETRO Easy how to purchase something on Etsy information for you: http://help.etsy.com/app/answers/detail/a_id/245/ P.S. If you have any questions, please do not hesitate to convo me ♥♥♥♥♥",
policy_payment: "I prefer payments to be made through PayPal or credit card, but will accept check or money order, as well.  All prices are listed in USD. Payment is due at the time of purchase if you are choosing to use PayPal or credit card. If you are choosing to make another form of payment it must be made within 7days of purchase ( please contact me via Etsy Conversation regarding if check or money order payment is not going to becoming within the 7 day time period. ) ",
policy_shipping: "ATTENTION ALL INTERNATIONAL BUYERS. I CAN NO LONGER ABSORB MAILING LOSSES AND REFUNDING COSTS DUE TO INTERNATIONAL MAIL PROBLEMS ANY LONGER. ALL INTERNATIONAL ORDERS MUST HAVE TRACKING AND INSURANCE COSTS APPLIED. PLEASE CONTACT ME IF YOU WISH TO BUY FROM RADICALLY RETRO AND WE WILL FIGURE OUT THE COSTS AT TIME OF PURCHASE TOGETHER. I WILL CONTINUE SHIPPING WORLD WIDE BUT I MUST NOW CHARGE FOR THE EXTRA SHIPPING OF TRACKING AND INSURANCE. I CAN STILL SHIP FIRST CLASS. IF YOU WANT TO BUY ONLY FIRST CLASS SHIPPING BUT ALL INTERNATIONAL BUYERS WILL HAVE TO ASSUME THE RISK OF PURCHASING THAT TYPE OF SHIPPING. All of my packages are packed with the utmost care. I ship within 4 business days of receipt of payment unless otherwise noted. I will keep you informed all the way. Good customer service is important to me. ♥ Please contact me with any concerns at all. I&#39;d be happy to work out any problems. I ship worldwide and offer combined shipping on multiple purchases. Domestic Shipping: Shipping is from California to destinations within the US via Parcel Post with AUTOMATIC DELIVERY CONFIRMATION INCLUDED INTO THE COST and Insurance if requested by buyer. Insurance will be included in the shipping cost for orders over $100.00 by the seller automatically. Purchases should be received within 2-4 business days of shipment on the West Coast , but may take up to 10-14 days on the East Coast. If orders have not arrived in that time frame, please feel free to contact me and I will be happy to work it out with you! If you want a rush delivery please contact me and I will adjust my shipping prices to accommodate the delivery. DIFFERENCES IN SHIPPING COST WILL BE REIMBURSED ASAP International shipping: Worldwide shipping via First class is available if my international costumers request it if you do you will assume all risk and all potential loss if the package is not delivered to you. I will only honor shipped Priority international or Express in the United Kingdom which is covered by the extra cost of insurance and tracking in case of loss of item. Please allow up to 4 weeks for first class international orders to arrive. International orders tracked and insured orders generally arrive in 4-10 business days, but may take more time. DIFFERENCES IN SHIPPING COST WILL BE REIMBURSED ASAP",
policy_refunds: "RETURNS, EXCHANGES & STORE CREDIT - Returns will be accepted for damaged purchases. Please contact me within 2 days of receiving damaged items to initiate the refund process. In addition, I will accept exchanges for store credit. Please contact me through Etsy Convo If you are not happy with the item. Please contact me with your grievance and if you feel it has been misrepresented I will accept the item back and will refund your purchase price in full including your return shipping charges. ♥♥♥♥♥♥ - Customer is responsible for shipping cost when returning purchases it will be refunded. The item(s) returned must be in the same condition as I sent in order for a full refund to be granted. DIFFERENCES IN SHIPPING COST WILL BE REIMBURSED ASAP after the item has been shipped to the buyer. ",
policy_additional: "❤ DIFFERENCES IN SHIPPING COST WILL BE REIMBURSED ASAP VIA PAYPAL AS SOON AS I RETURN TO FROM THE POST OFFICE ❤",
